import Modal from "react-bootstrap/Modal";
import Button from "react-bootstrap/Button";

const MyBoxes = ({
    myBoxes,
    handleMyBoxesClose,
    currentUser,
    userLocation,
}) => {
    const MyLocation = () => {
        return currentUser?.userBoxes.map((item, index) => {
            return (
                <li key={item.x}>
                    <div>Box {index + 1}</div>
                    <div>x: {item.x}</div>
                    <div>y: {item.y}</div>
                </li>
            );
        });
    };

    return (
        <Modal
            show={myBoxes}
            onHide={handleMyBoxesClose}
            backdrop="true"
            fade="true"
            centered="true"
        >
            <Modal.Header closeButton>
                <Modal.Title>My Boxes</Modal.Title>
            </Modal.Header>
            <Modal.Body>
                

                <form className="box-form">
                    <h6>Box 2</h6>
                    {/* {Object.hasOwn(currentUser, "_id") && (
                    <ul className="allBoxes">
                        <MyBoxes currentUser={currentUser} />
                    </ul>
                    )} */}

                    <h6>Location of the Box:</h6>
                    <img
                        className="fluid "
                        src="Icons/box-500x500.jpg"
                        alt=""
                    />
                    <span>What is in your Box?</span>
                    <p>Tag1 Tag2 Tag3</p>
                    <button type="button" className="btn btn-danger btn-sm">
                        delete
                    </button>
                    <hr size="10" />
                </form>
            </Modal.Body>
            <Modal.Footer>
                <Button variant="secondary" onClick={handleMyBoxesClose}>
                    Cancel
                </Button>
                <Button variant="primary" onClick={handleMyBoxesClose}>
                    Save settings
                </Button>
            </Modal.Footer>
        </Modal>
    );
};

export default MyBoxes;
